import React from "react";
import Button from "@material-ui/core/Button";

function Tiles(props) {
    return(
        <div>
            <p>{props.description}</p>
            <p>{props.price}</p>
            <Button variant='contained'>DETAILS</Button>
        </div>
    )
}

export default Tiles;
